import React, { useState } from "react";
import axios from "axios";

const Users = () => {
  const [tableName, setTableName] = useState("");
  const [columns, setColumns] = useState([]);
  const [inputValue, setInputValue] = useState("");
  const [sourceDefinition, setSourceDefinition] = useState({
    Name: "",
    columns: [],
  });
  const [selectedColumn, setSelectedColumn] = useState("");
  const [newColumnName, setNewColumnName] = useState("");
  const [newColumnType, setNewColumnType] = useState("");
  const [columnChanges, setColumnChanges] = useState([]);
  const [val, setVal] = useState([]);
  const [tableStatus, setTableStatus] = useState();
  // Handler function for the new column name input field
  const handleColumnNameChange = (e) => {
    setNewColumnName(e.target.value);
  };

  // Handler function for the new column type input field
  const handleColumnTypeChange = (e) => {
    setNewColumnType(e.target.value);
  };

  // Handler function for the confirm button
  const handleConfirm = (e) => {
    e.preventDefault();
    // Add the new column changes to the columnChanges state variable
    setColumnChanges([
      ...columnChanges,
      {
        columnName: selectedColumn,
        newColumnName: val,
        newColumnType: newColumnType,
      },
    ]);
    // Clear the input fields
    setNewColumnName("");
    setNewColumnType("");
  };

  const fetchColumns = async () => {
    try {
      const response = await axios.get(`http://localhost:8800/`);
      const columns = response.data.map((col) => ({
        column_name: col.column_name,
        data_type: col.data_type,
      }));
      setTableStatus("");
      setColumns(columns);
      setSourceDefinition({
        ...sourceDefinition,
        columns: columns,
      });
    } catch (error) {
      console.log(error);
      setTableStatus("Table not found");
    }
  };

  const handleColumnSelect = (column_name) => {
    setSelectedColumn(column_name);
  };

  const handleDownload1 = async () => {
    try {
      // Create a new object with the modified sourceDefinition
      const updatedSourceDefinition = {
        Name: tableName,
        SourceDB: "test", // Database Name
        SourceDefinition: sourceDefinition.SourceDB,
        columns: sourceDefinition.columns.map((col) => {
          // Check if there is a change for this column
          const columnChange = columnChanges.find(
            (change) => change.columnName === col.column_name
          );
          if (columnChange) {
            // Update the column name and data type based on the change
            return {
              ...col,
              column_name: columnChange.newColumnName,
              data_type: columnChange.newColumnType,
            };
          } else {
            return col;
          }
        }),
      };

      // Convert the updated sourceDefinition to JSON format
      const json = JSON.stringify(updatedSourceDefinition, null, 2);

      // Download the file
      const url = window.URL.createObjectURL(new Blob([json]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "output.json");
      document.body.appendChild(link);
      link.click();
    } catch (error) {
      console.log(error);
    }
  };
  const handleChange = (event) => {
    setInputValue(event.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const value = inputValue;
    // Send inputValue to server using fetch or axios
    const response = await axios.post("http://localhost:8800/", { value });
    console.log(response.data);
    setTableName(value);
  };

  const handleVal = (value, i) => {
    const allVal = [...val];
    const inputData = [...allVal];
    inputData[i] = value.target.value;
    setVal(inputData);
  };
  console.log(val);
  return (
    <div>
      <h1>Table Name:</h1>
      <p>{tableStatus}</p>
      <form onSubmit={handleSubmit}>
        <input type="text" value={inputValue} onChange={handleChange} />
        <button type="submit">Submit</button>
      </form>
      <p>Ready to fetch {tableName} table.</p>
      <h1>Load Table:</h1>
      <button onClick={fetchColumns}>Fetch Columns</button>
      <br />
      <h1>Columns:</h1>
      <ul>
        {columns.map((col, i) => (
          <li key={col.column_name}>
            {col.column_name} ({col.data_type})
            <input
              type="text"
              onClick={() => handleColumnSelect(col.column_name)}
              onChange={(e) => handleVal(col.column_name, i)}
            />
            <br />
          </li>
        ))}
      </ul>

      <>
        <h1>Edit Column:</h1>
        <p>Column Name: {selectedColumn}</p>
        <label>
          New Column Name:
          <input
            type="text"
            value={newColumnName}
            onChange={handleColumnNameChange}
          />
        </label>
        <br />
        <label>
          New Column Type:
          <input
            type="text"
            value={newColumnType}
            onChange={handleColumnTypeChange}
          />
        </label>
        <br />
        <button onClick={handleConfirm}>Confirm</button>
        <br />
        <button onClick={handleDownload1}>Download JSON</button>
      </>
      <br />
    </div>
  );
};

export default Users;
